<template>
<!--
    base64 002. 通过点击事件或其他事件将base64图片进行压缩，得到一个base64就立即派发给调用该组件的父组件中
    ***该组件一定要被父组件使用才行
  -->
<div>
  <button @click="ya">压缩图片</button>

</div>
</template>

<script type="text/ecmascript-6">
import {
  imageCompress
} from 'js-fun-bywhj'
export default {
  methods: {
    ya() {
      var img = new Image();
      img.src =
        `data:image/jpeg;base64,`;
      //大于100k图片进行压缩
      img.onload = function() {
        let imgDetail = imageCompress(img, 100, 10)
        this.$emit('xx', imgDetail)
      }
    }
  }
}
</script>

